import React from "react";
import { Routes, Route } from "react-router-dom";

//tsx
import Header from "./Components/Header";
import Footer from "./Components/Footer";

//css
import "./App.css";

function App() {
	return (
		<div className="main">
			<Header></Header>
			<Routes>
				<Route path=""></Route>
			</Routes>
			<Footer></Footer>
		</div>
	);
}

export default App;
